//Set height of elements to height of tallest element
let growToTallestElement = function(sourceElements, targetElement) {
    let elHeight = 0;
    $(sourceElements).each(function() {
        if ( $(this).height() > elHeight ) {
            elHeight = $(this).height();
        }
        $(targetElement).css("height", elHeight);
    })
};

//Dynamically load recaptcha JS

let recaptchaLoaded = false;

function loadRecaptcha(element, percentage) {
    if($(element).length > 0)  {
        $(element).each( function() {
            var h = $(window).height();
            var s = $(document).scrollTop();
            var e = $(this).offset().top;
            var x = h + s;
            var a = h * percentage;

            if (x > e + a && recaptchaLoaded == false) {
                $.getScript("https://www.google.com/recaptcha/api.js");
                recaptchaLoaded = true;
            }
        });
    }
}

//Really bad practice, but hey..its friday and I want a beer.
jQuery( function( $ ) {
    // Orderby
    $( '.woocommerce-ordering' ).on( 'change', 'select.orderby', function() {
        $( this ).closest( 'form' ).submit();
    });

    // Target quantity inputs on product pages
    $( 'input.qty:not(.product-quantity input.qty)' ).each( function() {
        var min = parseFloat( $( this ).attr( 'min' ) );

        if ( min >= 0 && parseFloat( $( this ).val() ) < min ) {
            $( this ).val( min );
        }
    });
});

